import { Card, CardContent, Typography, Grid } from '@material-ui/core';


 const PharmacyList = ({ data }) => {
  const [fetchedData, setFetchedData] = useState([]);

  useEffect(() => {
    setFetchedData(data);
  });
  console.log(fetchedData);
  return(
      <div>
        {data.data.map((item) => (
          <ul key={item.id}>
            <li>{item.eczane_adi}</li>
          </ul>
        ))}
      </div>
  )
}

 

 export default PharmacyList;
